<?phpadd_action('wp_ajax_wb_total_input', 'wb_total_input');//add_action('wp_ajax_nopriv_wb_total_input', 'wb_total_input');function wb_total_input() {	ShoutOut::push_event( 16 );	update_user_meta(wp_get_current_user()->ID, 'wb_total_input', addslashes(str_replace(',', '.', $_POST['total-input'])));	echo 'ok';	die;}add_action('wp_ajax_get_wb_total_input', 'wb_get_total_input');//add_action('wp_ajax_nopriv_get_wb_total_input', 'wb_get_total_input');function wb_get_total_input() {	echo get_user_meta(wp_get_current_user()->ID, 'wb_total_input', 1);	die;}add_action('wp_ajax_wb_save', 'wb_save');//add_action('wp_ajax_nopriv_wb_save', 'wb_save');function wb_save() {	ShoutOut::push_event( 17 );	echo update_user_meta(wp_get_current_user()->ID, 'wb_save', ($_POST['data']));	die;}add_action('wp_ajax_wb_get_save', 'wb_get_save');//add_action('wp_ajax_nopriv_wb_get_save', 'wb_get_save');function wb_get_save() {	echo json_encode((get_user_meta(wp_get_current_user()->ID, 'wb_save', 1)));	die;}add_action('wp_ajax_wb_todo_icon', 'wb_todo_icon');//add_action('wp_ajax_nopriv_wb_todo_icon', 'wb_todo_icon');function wb_todo_icon() {	$id = addslashes($_POST['id']);	$name = addslashes($_POST['name']);	if (WeddingBudgetClass::is_in_todo($id, $name)) {		?>		<div class="wb-todo-table__coin wb-todo-table__coin--gold">			<img				src="data:image/svg+xml;utf8;base64,"				width="28"/>		</div>		<?php	}	die;}